function OnRecvPacket(p)
	if p.header == 0x3F then 
		p.pos = 5
		local x = p:DecodeF()
		local z = p:DecodeF()
		local targetNetworkID = p:DecodeF()
		local sourceNetworkID = p:DecodeF()
		local typeId = p:Decode1()
		local unit = objManager:GetObjectByNetworkId(sourceNetworkID)
